import React, { useState } from 'react';

const App = () => {
    const [num, setNum] = useState(0);

    // let incr = () => {
    //     setNum(num + 1);
    //     alert('hey');       
    // }

    return (
        // <button onClick={incr}> Click me {num} </button>
        <button onClick={
            (() => {
                setNum(num + 1);
            },
            () => {
                alert('hey');
            })
        }> Click me {num} </button>
    );
}

export default App;
